import { complete, errored } from "@attio/fetchable-npm";
export async function uploadBundle(bundle, uploadUrl) {
    try {
        await fetch(uploadUrl, {
            method: "PUT",
            body: bundle,
            headers: {
                "Content-Type": "text/javascript",
                "Content-Length": String(Buffer.from(bundle).length),
            },
        });
        return complete(undefined);
    }
    catch {
        return errored({ code: "BUNDLE_UPLOAD_ERROR", upload_url: uploadUrl });
    }
}
